import { Card, CardContent } from '@material-ui/core'
import React, { useEffect, useState } from 'react'
import { useParams, useHistory } from 'react-router-dom'
import { findIncicleById } from '../actions/IncicleFyndyID'

export function CardsPage() {
  const [card, setCard] = useState(null)
  const { history } = useHistory()

  const { id } = useParams()

  useEffect(() => {
    async function fechData() {
      const { data, error } = await findIncicleById(id)
      if (error) {
        history.push('/')
      }
      setCard(data)
      console.log(data)
    }
    fechData()
  }, [history, id])

  return (
    <>
      <Card sx={{ width: '980px', mb: 5 }}>
        {card.map((e, i) => (
          <CardContent row key={i}>
            <p>{e.title}</p>
          </CardContent>
        ))}
      </Card>
    </>
  )
}
